    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments from May through July of
    1940. The report begins by summarizing the weather conditions, water conditions,
    and fires. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. The public
    relations section of the report describes recreational uses and Refuge visitors.
    Resource management is outlined; topics include haying and cooperative farming.",nt"license_title":
